import React from "react";

export default function skillBadge(props) {
  return (
    <div className="item">
      <img
        src={props.img}
        alt="Image"
        style={{ height: 100, width: 100 }}
      />
      <h5 style={{ margin: 10 }}>{props.skill}</h5>
    </div>
  );
}
